export let dataProductos = [];

let productos = [
    { id: 1, nombre: "Coca Cola", precio: 5.00, imagen: "https://m.media-amazon.com/images/I/51v8nyxSOYL._SL1500_.jpg" },
    { id: 2, nombre: "Pizza", precio: 8.00, imagen: "data:image/jpeg;base64," },
    { id: 3, nombre: "Lays", precio: 5.00, imagen: "data:image/jpeg;base64," },
    { id: 4, nombre: "Dorito Rojo", precio: 5.00, imagen: "data:image/jpeg;base64," },
    { id: 5, nombre: "Pepsi", precio: 7.00, imagen: "data:image/jpeg;base64," },
    { id: 6, nombre: "Manzana", precio: 3.00, imagen: "data:image/jpeg;base64," },
    { id: 7, nombre: "Pan", precio: 15.00, imagen: "https://i2.wp.com/pizcadsal.diariocorreo.pe/wp-content/uploads/2016/11/Export_MG_5815.jpg?resize=640%2C960" },
    { id: 8, nombre: "Agua Pura", precio: 5.00, imagen: "data:image/jpeg;base64," },
    { id: 9, nombre: "Taqueritos", precio: 3.00, imagen: "data:image/jpeg;base64," },
    { id: 10, nombre: "Takis", precio: 6.00, imagen: "data:image/jpeg;base64," },
    { id: 11, nombre: "Tacos", precio: 15.00, imagen: "data:image/jpeg;base64," },
    { id: 12, nombre: "Dobladas", precio: 15.00, imagen: "data:image/jpeg;base64," }
];

for (let i = 0; i < productos.length; i++) {
    let productoDiv = document.createElement('div');
    productoDiv.classList.add('producto');

    let imagen = document.createElement('img');
    imagen.src = productos[i].imagen;
    imagen.alt = productos[i].nombre;
    productoDiv.appendChild(imagen);

    let nombre = document.createElement('h3');
    nombre.textContent = productos[i].nombre;
    productoDiv.appendChild(nombre);

    let precio = document.createElement('p');
    precio.textContent = `Q${productos[i].precio.toFixed(2)}`;
    productoDiv.appendChild(precio);

    let botonEliminar = document.createElement('button');
    botonEliminar.textContent = 'Eliminar';
    botonEliminar.addEventListener('click', () => {
        productoDiv.remove(); 
        productos.splice(i, 1); 
        console.log('Producto eliminado:', productos);
    });

    productoDiv.appendChild(botonEliminar);
    document.body.appendChild(productoDiv);
}

console.log(productos);
